import logo from './logo.svg';
import './App.css';
import React, {useContext} from 'react';

var session = {
  loggedIn: false,
}

const SessionContext = React.createContext(session);

function App() {
  return (
    <div className="App">
      <SessionContext.Provider value={session}>
          <Test/>
      </SessionContext.Provider>
    </div>
  );
}

const Test = (props) => {
    console.log(props)
    return (
        <div>Hello, you are {getSession.loggedIn ? null : "not"} logged in</div>
    )
}

export default App;
